We should add uniffi as a build, bin, and library dependency, but each has a different feature. TBH, I could not figure out how to have three different dependencies in Cargo.toml, so I combined the features needed for bin and lib dependencies u nder [dependencies] Inside glue/mobile/Cargo.toml [package]
name = "mobile"
version = "0.1.0"
edition = "2021" [lib]
name = "exa"
crate-type = ["staticlib", "cdylib"] [dependencies]
uniffi = { version = "0.23.0", features = ["cli"] } [build-dependencies]
uniffi = { version = "0.23.0", features = ["build"] } Let us start with generating the bindings function. Create in our mobile crate main.rs and add the generating function: fn main() { uniffi::uniffi_bindgen_main();
} Now to our library, remove all the content of lib.rs in our mobile crate and include the scaffold rust file generated by uniffi (not generated yet. We are going to do so in build.rs) uniffi::include_scaffolding!("exa"); And finally, create a build.rs file inside the mobile crate but outside the src. fn main() { uniffi::generate_scaffolding("./src/exa.udl").unwrap();
} In build.rs, we want to generate a scaffolding from a file called exa.udl inside src. You might see errors if your editor builds on save since the file exa.udl still needs to be created. Let us create it in the mobile crate inside the src namespace exa { }; Now the errors should be gone. And we can generate bindings, but wait, let us add a simple functionality and then generate the bindings to see if all is good.

