On Android, we log using logcat. On iOS, we log to stdout, so for Android, we can use android_logger, and for iOS, we can use simple_logger For better optimizations, we can have conditional dependencies, add android_logger if the target operating system is Android, else use simple_logger [package]
name = "mobile"
version = "0.1.0"
edition = "2021" [lib]
name = "exa"
crate-type = ["staticlib", "cdylib"] [dependencies]
log = "0.4.17"
log-panics = "2.1.0"
uniffi = { version = "0.23.0", features = ["cli"] } [target.'cfg(target_os="android")'.dependencies]
android_logger = "0.13.1" [target.'cfg(not(target_os="android"))'.dependencies]
simple_logger = "4.0.0" [build-dependencies]
uniffi = { version = "0.23.0", features = ["build"] } Now create logger.rs in src in our mobile crate. We want to use android_logger to initialize the logger if the target OS is Android. We can create a configuration block and check the target_os use log::{info, LevelFilter}; pub fn init_logger() { #[cfg(target_os = "android")] { android_logger::init_once( android_logger::Config::default() .with_max_level(LevelFilter::Trace) .with_tag("Exa"), ); info!("Logger initialized"); } #[cfg(not(target_os = "android"))] { let logger = simple_logger::SimpleLogger::new() .with_level(LevelFilter::Trace) .with_colors(false) .init(); match logger { Ok(()) => info!("Logger initialized"), Err(_) => { }, }; } log_panics::init();
} Now add that as a module inside lib.rs mod logger; use crate::logger::*; uniffi::include_scaffolding!("exa"); And finally, add the function signature to exa.udl so we can generate the bindings! namespace exa { void init_logger();
};

