We want to execute the main.rs function inside the mobile crate to generate the bindings. To do so, open the terminal and change the directory to the root project (exa-library). From there, we run cargo run and pick the binary we want to run. cargo run --bin mobile -- --help You should be able to see the help message: Scaffolding and bindings generator for Rust USAGE: mobile <SUBCOMMAND> OPTIONS: -h, --help Print help information -V, --version Print version information SUBCOMMANDS: generate Generate foreign language bindings help Print this message or the help of the given subcommand(s) print-json Print the JSON representation of the interface from a dynamic library scaffolding Generate Rust scaffolding code Let us generate rust scaffolding and check the output: cargo run --bin mobile -- \ scaffolding ./glue/mobile/src/exa.udl \ -o ./target/bindings This will generate exa.uniffi.rs inside target/bindings. If you open the file and scroll down, you should see our init_logger, but not precisely as we anticipate it. It has the form of <namespace>-<hash>-<function name> to avoid collisions. For me, it was generated like this: #[doc(hidden)]
#[no_mangle]
#[allow(clippy::let_unit_value)]
pub extern "C" fn r#exa_5e46_init_logger( call_status: &mut uniffi::RustCallStatus
) { uniffi::deps::log::debug!("exa_5e46_init_logger"); uniffi::call_with_output(call_status, || { #[allow(clippy::redundant_closure)] r#init_logger() })
} Let us generate Kotlin bindings and check the output cargo run --bin mobile -- \ generate ./glue/mobile/src/exa.udl \ -l kotlin \ -o ./target/bindings The output should be target/bindings/uniffi/exa/exa.kt Again, scroll down and check the initLogger function: fun `initLogger`() = rustCall() { _status -> _UniFFILib.INSTANCE.exa_5e46_init_logger(_status) } Notice the function name is escaped using the backticks `initLogger`. So our functions doesn't collide with a language keyword. For example: we can have a function named switch to switch between two things. It's fine for Kotlin and Rust but Swift will start throwing errors. So we should escape the name. This calls another function called exa_5e46_init_logger inside this file. As you noticed, both the rust scaffolding and the Kotlin bindings have the hash 5e46 in my case. We can also do the same for Swift: cargo run --bin mobile -- \ generate ./glue/mobile/src/exa.udl \ -l swift \ -o ./target/bindings The output is pretty similar to the Kotlin one: public func `initLogger`() { try! rustCall() { exa_5e46_init_logger($0) }
} Don't expect the output to be formatted like this, I manually formatted that for the sake of have a good looking code inside the book ðŸ˜…
